import React ,{useEffect,useState}from 'react';
import "./home.css";
import{Image}from"cloudinary-react"
import Axios from"axios"
import CustomizedDialogs from "../../components/helper/dialog/dialog"

const Home = () => {

    const[list,setList]=useState([]);
    const username = localStorage.getItem("username");

    useEffect(()=>{
        Axios.get("http://localhost:3001/upload",{params:username}
        ).then((res)=>{
            setList(res.data);
        })
    },[]);


    return (

        <div>
                        <CustomizedDialogs/>
            <div className="home">

            {list.map((val)=>{
                return(

                <div className="post">
                    <div className="image">
                        <Image cloudName="dyflxpls8" publicId={val.imageid}/>
                    </div>
                    <div className="text">
                        <div className="title">{val.title}by{val.username}</div>
                        <div className="discription">{val.discription}</div>
                    </div>
                </div>
           )
            })}
             </div>
        </div>
    );
};



export default Home;
